window.bookSummaryJSON = "<p><b>An 18-year-old chieftain's daughter must find a way to kill her villageâ€™s oppressive deity if she ever wants to return home in </b><b><i>Warrior of the Wild</i></b><b>, the Viking-inspired YA standalone fantasy from Tricia Levenseller, author of </b><b><i>Daughter of the Pirate King</i></b><b>. </b></p> <p><i>How do you kill a god? </i> </p> <p>As her father's chosen heir, 18-year-old Rasmira has trained her whole life to become a warrior and lead her village. But when her coming-of-age trial is sabotaged and she fails the test, her father banishes her to the monster-filled wilderness with an impossible quest: To win back her honor, she must kill the oppressive god who claims tribute from the villages each year or die trying.</p>"; 
